    body {

      margin: 0;

      line-height: 1.8;

      margin: 1.5em 4em;
    }

    h2 span { font-weight: 900; }

    a {
      text-transform: uppercase;
      padding: 1vw;
      margin-top: 4vh;
      background-color: #fff;
      border-radius: 40px;
      text-decoration: none;
      font-size: 1.25em;
      font-weight: 100;
      letter-spacing: 0.4em;
    }

    a:active,
    a:hover,
    a:link,
    a:visited { color: #2E2B33; }

    @media screen and (max-width: 600px) {
      body { display: block; }

      .row { padding: 10vh 5vh; }

      h1, h2 { font-size: 1.1em; }

        margin: 5vh 3vh;
        font-size: .9em;
      }

      svg { height: 20vh; }
    }
  </style>
